      <Routes>
                 <Route path="/" element={<Landingpage/>} />
                 <Route path="/login" element={<Loginpage/>} >
                  <Route index element={<Login/>}/>
                  <Route path="signup" element={<Login/>}/>
                 </Route>
      </Routes> 
    </div>
  );
}

export default App;
